CREATE DEFINER=`root`@`%` PROCEDURE `SignIn`(IN _userId int(11))
BEGIN

	SET @days = 0;

	SET @lastDay = -1;

	select consecutive_days INTO @days from gameaccount.activity_sign where userId = _userId;

	select last_sign_in_date INTO @lastDay from gameaccount.activity_sign where userId = _userId;

	
    IF @lastDay = CURDATE() THEN
        SELECT 0 AS rcode, @lastDay as lastDay;
    ELSE
     
		if @lastDay >= 0 then
		    if @lastDay < 7 then
				UPDATE activity_sign SET last_sign_in_date = NOW(), consecutive_days = @days +1 WHERE userId = _userId;
				SELECT @days +1 AS rcode, @lastDay as lastDay ;
		    else 
		    	UPDATE activity_sign SET last_sign_in_date = NOW(), consecutive_days = 1 WHERE userId = _userId;
		        SELECT 1 AS rcode, @lastDay as lastDay ;
		    end if;
		else
			INSERT INTO activity_sign(userId, last_sign_in_date, consecutive_days) VALUES(_userId, NOW(), 1);
			SELECT 1 AS rcode, @lastDay as lastDay;
		end if;


    END IF;

	

